import ApexCharts from "react-apexcharts";
import $ from 'jquery';
function Chart() {

  var options = {
    series: [{
        data: [3, 16, 2, 14, 15, 7, 9, 21, 7, 5, 4],
    },{
        data: [11, 2, 3, 1, 10, 13, 7, 8, 21, 22, 3],
    }],
    chart: {
        type: 'line',
        height: 350
    },
    stroke: {
        curve: 'stepline',
    },
    dataLabels: {
        enabled: false
    },
    title: {
        text: 'Stepline Chart',
        align: 'left'
    },
    markers: {
        hover: {
            sizeOffset: 4
        }
    }
};
    return <ApexCharts
    options={options}
    series={options.series}
    typs={options.chart}
    width={500}
    height={300}
    />
}
export default Chart;
